import React, { Component } from "react";

class Heart extends Component {
	render() {
		const { buttonState } = this.props;
		console.log("props", this.props);
		return (
			<button
				className='fa fa-heart dark-gray'
				aria-hidden={handleButtonDesign(buttonState)}></button>
		);
	}
}
function handleButtonDesign(x) {
	if (x === 0) {
		return "ture";
	} else {
		return "false";
	}
}

export default Heart;
